import { MoreVert, ThumbUp, ThumbUpOutlined } from "@mui/icons-material";
import { Avatar, Button, Card, CardActions, CardContent, CardHeader, IconButton, styled } from "@mui/material";

const CardPost = styled(Card)(({theme}) => ({
    marginLeft: 'auto',
    marginRight: 'auto'
}));

const CardSimplePost = () => {
    return (
        <CardPost sx={{maxWidth: 700}} >
            <CardHeader 
            avatar={<Avatar src="/broken-image.jpg" />}
            action={
                <IconButton aria-label="settings">
                  <MoreVert />
                </IconButton>
            }
            title="Tanvir Rahman Tareq"
            subheader="December 3, 2021" />
            <CardContent>

            </CardContent>
            <CardActions>
                <Button size="small" startIcon={<ThumbUpOutlined />}>Upvote</Button>
                <Button size="small">Downvote</Button>
                <Button size="small">Share</Button>
            </CardActions>
        </CardPost>
    );
};

export default CardSimplePost;
